paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 10 ? 10 : value));
            let normalizedValue = (value - 0) / (10 - 0);
            return normalizedValue;
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 360 ? 360 : value));
            let normalizedValue = (value - 0) / (360 - 0);
            return normalizedValue;
        }
    case 2:
        {
            value = (value < 10 ? 10 : (value > 20000 ? 20000 : value));
            let normalizedValue = (value - 10) / (20000 - 10);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 0.1 ? 0.1 : (value > 100 ? 100 : value));
            let normalizedValue = (value - 0.1) / (100 - 0.1);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < -90 ? -90 : (value > 90 ? 90 : value));
            let normalizedValue = (value - -90) / (90 - -90);
            return normalizedValue;
        }
    case 6:
        {
            value = (value < -180 ? -180 : (value > 180 ? 180 : value));
            let normalizedValue = (value - -180) / (180 - -180);
            return normalizedValue;
        }
    default:
        index -= 7;

        if (index < this.p_01[0].getNumParameters()) {
            {
                return this.p_01[0].convertToNormalizedParameterValue(index, value);
            }
        }

        return value;
    }
}

